script: |
  super -f text -I q83.spq | sort > q83.out

inputs:
  - name: q83.spq
    data: |
      SELECT + col0 FROM tab0 (FORMAT parquet) WHERE NOT NULL IN ( - CAST ( + col2 AS INTEGER ) + - - 56 ) AND 78 NOT BETWEEN col1 AND + col2 - col0 * - 69;
  - name: tab0

outputs:
  - name: q83.out
    data: |
